import { selectMerchant } from "@redux";
import { Col, Row } from "antd";
import { useSelector } from "react-redux";
import styled from "styled-components";

interface IProps {
    socials: JSX.Element[];
}

export const ComponentSocialMedia = (props: IProps) => {
    //page props
    const { socials } = props;
    //redux page
    const { signUpSettings } = useSelector(selectMerchant);
    //page variable
    const signUpMethods = signUpSettings?.signUpMethods;
    console.log(signUpMethods);

    return (
        <StyledContainer>
            <Row gutter={8}>
                {socials.map((item) => {
                    return <Col span={24 / socials.length}>{item}</Col>;
                })}
            </Row>
        </StyledContainer>
    );
};

const StyledContainer = styled.div``;
